-- Updated 2023-08-27 (fixing error where Taps data was all on the same day)

-- Prevent 10,000 lines of "1 row created"
set termout off;
-- Ampersands are interpreted by Oracle as a substitution marker.
-- We don't need that. In fact, some of our data contains ampersands!
set scan off;
set define off;
-- Make sure the time-stamps get interpreted correctly.
ALTER SESSION SET NLS_DATE_FORMAT='YYYY-MM-DD HH24:Mi:SS';

-- Explicitly start a transaction.
SET TRANSACTION READ WRITE;

-- This version of Oracle doesn't support DROP ... IF EXISTS ...
-- Errors at this point are probably because a table, sequence or trigger
-- doesn't exist and therefore there's nothing to delete.
DROP TABLE TAPS;
DROP TABLE CUSTOMERS;
DROP TABLE FARES;
DROP TABLE STOPS;
DROP SEQUENCE TAP_ID_SEQ;
DROP TRIGGER BI_TAP_ID;
DROP TRIGGER BI_BASIC_FARES;
DROP TRIGGER BI_EIGHT_HALF;
DROP TRIGGER BI_CONTINUATIONS;


CREATE TABLE CUSTOMERS (customer_id INT, class VARCHAR2(10));
CREATE TABLE FARES (zone_count INT, class VARCHAR2(10), amount INT);
CREATE TABLE STOPS (stop_id VARCHAR2(15), stop_name VARCHAR2(60), zone INT);
CREATE TABLE TAPS (tap_id INT, customer_id INT, stop_id VARCHAR2(15), timestamp DATE, charge INT);


ALTER TABLE CUSTOMERS ADD CONSTRAINT PK_CUST_ID PRIMARY KEY (customer_id);
ALTER TABLE STOPS ADD CONSTRAINT PK_STOP_ID PRIMARY KEY (stop_id);
ALTER TABLE TAPS ADD CONSTRAINT PK_TAP_ID PRIMARY KEY (tap_id);



set termout on;
set define on;

COMMIT;
